import './App.css'
import useWindowDimensions from './constants/Dimensions'

function App() {
  const { height, width } = useWindowDimensions()
  return (
    <div className="App">
      <div
        style={{
          display: 'flex',
          height: height * 0.1,
          backgroundColor: '#171544',
          flexDirection: 'row',
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.1 - 20,
            marginTop: 10,
            marginBottom: 10,
            marginLeft: 10,
            marginRight: 10,
          }}
        />
        <div
          style={{
            width: 80,
            height: 80,
            backgroundColor: 'blue',
          }}
        ></div>
      </div>
    </div>
  )
}

export default App
